// === FOOTER ===
.section-footer {
  @include list-null;
  position: relative;
  background-color: rgba(0, 9, 18, 1);
  height: 1020px;
  display: flex;
  justify-content: center;
}
.contact-wrapper {
  position: relative;
  background: url("../img/Group 12.png") no-repeat;
  width: 1433px;
  height: 895px;
  border-radius: 15px;
}
.contact-info {
  position: absolute;
  width: 874px;
  height: 537px;
  margin-left: 144px;
  margin-top: 90px;

  &--wrapper {
    display: grid;
    grid-template-columns: repeat(2, 371px);
    grid-template-rows: repeat(2, 50px);
    grid-gap: 30px;
    justify-items: stretch;
  }

  &-title {
    font-weight: 700;
    font-size: 30px;
    line-height: 34px;
    color: #f4f9ff;
    margin-bottom: 82px;
  }
  &__name,
  &__email,
  &__phone,
  &__question {
    input[type="text"],
    select {
      background-color: transparent;
      border-style: none;
      border-bottom: 1px solid #cee5ff;
      width: 370px;
      padding-bottom: 12px;
      padding-left: 0;
      display: inline-block;
      font-weight: 500;
      font-size: 18px;
      line-height: 21px;
      color: rgba(244, 249, 255, 0.9);
    }
    :focus {
      outline-offset: 0px;
      outline: none;
    }
    ::placeholder {
      font-weight: 500;
      font-size: 18px;
      line-height: 21px;
      color: rgba(244, 249, 255, 0.9);
    }
  }
  &__question {
    .questions {
      -webkit-appearance: none;
      -moz-appearance: none;
      background: url("../img/Vector 5.png"), #000d1a;
      background-repeat: no-repeat, repeat; /* Add custom arrow */
      background-position: right 0.7em top 45%, 0 0;
    }
  }

  &__message-wrapper {
    width: 770px;
    height: 134px;
    margin-top: 50px;
    display: flex;
    flex-flow: column wrap;

    .right {
      margin-top: 100px;
      margin-left: 40px;
    }

    .title {
      font-weight: 500;
      font-size: 18px;
      line-height: 21px;
      color: rgba(244, 249, 255, 0.9);
    }
    input[type="text"],
    select {
      background-color: transparent;
      border-style: none;
      border-bottom: 1px solid #cee5ff;
      width: 780px;
      padding-top: 12px;
      padding-bottom: 113px;
      padding-left: 0;
      display: inline-block;
      font-weight: 500;
      font-size: 18px;
      line-height: 21px;
      color: rgba(244, 249, 255, 0.9);
    }
    :focus {
      outline-offset: 0px;
      outline: none;
    }
  }
  .button {
    border-radius: 100px;
    width: 48px;
    height: 48px;
    box-shadow: 0px 5px 20px rgba(206, 229, 255, 0.56);
    background: url("../img/Vector 6.png"),
      linear-gradient(180.92deg, #b4d8ff 1.59%, #f1f8ff 98.41%);
    background-repeat: no-repeat, repeat;
    background-position: center;
    transition: 0.2s ease;
  }
  .button:hover {
    box-shadow: 0 0 0 0;
    transition: 0.2s ease;
  }
  &__checkboxes {
    margin-top: 75px;
    display: flex;
    flex-flow: column;

    .question1 label,
    .question2 label {
      margin-left: 10px;
      font-weight: 500;
      font-size: 14px;
      line-height: 16px;

      color: #999999;
    }

    .question1 input,
    .question2 input {
      width: 15px;
      height: 15px;
    }

    .question1,
    .question2 {
      display: flex;
      align-content: center;
    }

    .question1 {
      margin-bottom: 10px;
    }
  }
}
