  justify-content: center;
  background-color: rgba(0, 9, 18, 1);
  font-size: 14px;
  line-height: 16px;
  text-align: center;
  color: rgba(220, 225, 231, 0.1);
  margin-top: -10px;
  padding-bottom: 10px;
}

